var logoBase64 = ""

func drawFooter(c *creator.Creator, font *model.PdfFont) {
	c.DrawFooter(func(block *creator.Block, args creator.FooterFunctionArgs) {
		p := c.NewStyledParagraph()
		p.SetTextAlignment(creator.TextAlignmentCenter)

		chunk := p.Append(fmt.Sprintf("Page %d of %d", args.PageNum, args.TotalPages))
		chunk.Style.Font = font
		chunk.Style.FontSize = 8
		chunk.Style.Color = creator.ColorRGBFrom8bit(63, 68, 76)

		block.Draw(p)
	})
}

func createDonationReceipt(c *creator.Creator, font, fontBold *model.PdfFont, info DonationInfo) error {
	lang := info.Language
	if _, ok := translations[lang]; !ok {
		lang = "tr" // Default to Turkish if language is not supported
	}
	t := translations[lang]

	// Title
	middleTitle := c.NewStyledParagraph()
	middleTitle.SetTextAlignment(creator.TextAlignmentCenter)
	for i := 0; i < len(upperTitle); i++ {
		// add a new line for each title
		middleTitle.Append("\n")
		chunk := middleTitle.Append(upperTitle[i])
		chunk.Style.FontSize = 8
	}
	c.Draw(middleTitle)

	// Add logo
	logoData, err := base64.StdEncoding.DecodeString(logoBase64)
	if err != nil {
		return fmt.Errorf("error decoding logo: %v", err)
	}
	img, err := c.NewImageFromData(logoData)
	if err != nil {
		return fmt.Errorf("error creating image from data: %v", err)
	}
	img.ScaleToHeight(50)
	pageWidth := c.Width()
	img.SetPos(pageWidth-img.Width()-50, 50)
	err = c.Draw(img)
	if err != nil {
		return fmt.Errorf("error drawing logo: %v", err)
	}
	// add a new line to separate the logo from the title
	emptySpace := c.NewStyledParagraph()
	emptySpace.SetTextAlignment(creator.TextAlignmentCenter)
	emptySpace.Append("\n\n")
	c.Draw(emptySpace)

	// Add the donator's name and address
	donatorName := c.NewStyledParagraph()
	donatorName.SetTextAlignment(creator.TextAlignmentLeft)
	chunk := donatorName.Append(info.Name)
	chunk.Style.Font = fontBold
	chunk.Style.FontSize = 10
	c.Draw(donatorName)

	// add a new line to separate the name from the address
	emptySpaceAfterDonatorName := c.NewStyledParagraph()
	emptySpaceAfterDonatorName.SetTextAlignment(creator.TextAlignmentCenter)
	emptySpaceAfterDonatorName.Append("\n")
	c.Draw(emptySpaceAfterDonatorName)

	// Add address with spacing
	addressSplit := strings.Split(info.Address, "\n")
	for _, line := range addressSplit {
		if line != "" {
			donatorAddress := c.NewStyledParagraph()
			donatorAddress.SetTextAlignment(creator.TextAlignmentLeft)
			addressChunk := donatorAddress.Append(line)
			addressChunk.Style.FontSize = 10
			c.Draw(donatorAddress)
			// Add a small empty line for spacing
			emptyLine := c.NewStyledParagraph()
			emptyLineChunk := emptyLine.Append("\n")
			emptyLineChunk.Style.FontSize = 4 // Adjust the font size for the empty line here
			c.Draw(emptyLine)
		}
	}

	// add a new line to separate the logo from the title
	emptySpace2 := c.NewStyledParagraph()
	emptySpace2.SetTextAlignment(creator.TextAlignmentCenter)
	emptySpace2.Append("\n\n")
	c.Draw(emptySpace2)

	// add a new line to the right with the date of the receipt
	emptySpace3 := c.NewStyledParagraph()
	emptySpace3.SetTextAlignment(creator.TextAlignmentRight)
	emptySpace3.Append(info.CreationDate)
	c.Draw(emptySpace3)

	// Title
	title := c.NewStyledParagraph()
	title.SetTextAlignment(creator.TextAlignmentLeft)
	titlechunk := title.Append(t.YourDonoOurThank)
	titlechunk.Style.Font = fontBold
	titlechunk.Style.FontSize = 10
	c.Draw(title)

	// Content
	content := c.NewStyledParagraph()
	content.SetMargins(0, 0, 20, 0)

	// Greetings
	content.Append(fmt.Sprintf(t.Greetings, info.Name) + "\n\n").Style.Font = fontBold

	// Main text
	content.Append(t.Main + "\n\n")

	receival := fmt.Sprintf(t.Receival, info.Year, info.Value, info.Currency)

	// Parse and add the receival text with bold parts
	parts := strings.Split(receival, "<strong>")
	content.Append(parts[0])
	for i := 1; i < len(parts); i++ {
		subParts := strings.SplitN(parts[i], "</strong>", 2)
		if len(subParts) == 2 {
			boldChunk := content.Append(subParts[0])
			boldChunk.Style.Font = fontBold
			content.Append(subParts[1])
		} else {
			content.Append(parts[i])
		}
	}
	content.Append("\n\n")

	// Thanks
	content.Append(t.Thanks + "\n\n")

	// Goodbye
	content.Append(t.Goodbye)

	c.Draw(content)

	return nil
}

func Handler(request events.APIGatewayV2HTTPRequest) (events.APIGatewayProxyResponse, error) {
	var donationInfo DonationInfo
	err := json.Unmarshal([]byte(request.Body), &donationInfo)
	if err != nil {
		return events.APIGatewayProxyResponse{StatusCode: 400, Body: "Invalid JSON input"}, nil
	}

	font, err := model.NewStandard14Font("Helvetica")
	if err != nil {
		return events.APIGatewayProxyResponse{StatusCode: 500}, err
	}

	fontBold, err := model.NewStandard14Font("Helvetica-Bold")
	if err != nil {
		return events.APIGatewayProxyResponse{StatusCode: 500}, err
	}

	c := creator.New()
	c.SetPageMargins(50, 50, 50, 50)

	drawFooter(c, font)

	if err := createDonationReceipt(c, font, fontBold, donationInfo); err != nil {
		return events.APIGatewayProxyResponse{StatusCode: 500}, err
	}

	var buf bytes.Buffer
	if err := c.Write(&buf); err != nil {
		return events.APIGatewayProxyResponse{StatusCode: 500}, err
	}

	pdfBase64 := base64.StdEncoding.EncodeToString(buf.Bytes())

	return events.APIGatewayProxyResponse{
		Headers: map[string]string{
			"Content-Type":        "application/pdf",
			"Content-Disposition": "attachment; filename=donation_receipt.pdf",
		},
		Body:            pdfBase64,
		StatusCode:      200,
		IsBase64Encoded: true,
	}, nil
}

func main() {
	lambda.Start(Handler)
}
